import React, { useState } from "react";
import axios from "axios";

function App() {
  const [namespace, setNamespace] = useState("");
  const [podName, setPodName] = useState("");
  const [response, setResponse] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleAnalyze = async () => {
    setLoading(true);
    try {
      const res = await axios.post("http://localhost:8000/analyze", {
        namespace,
        pod_name: podName,
      });
      setResponse(res.data);
    } catch (error) {
      console.error("Error calling API:", error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-green-100 to-blue-100 p-8">
      <h1 className="text-4xl font-bold text-center text-blue-700 mb-8 shadow-sm">
        HealOps – Kubernetes Pod Analyzer
      </h1>

      <div className="max-w-xl mx-auto bg-white p-6 rounded-2xl shadow-md">
        <label className="block mb-2 font-semibold text-gray-700">Namespace</label>
        <input
          type="text"
          value={namespace}
          onChange={(e) => setNamespace(e.target.value)}
          className="w-full p-2 border rounded mb-4"
          placeholder="Enter namespace"
        />

        <label className="block mb-2 font-semibold text-gray-700">Pod Name</label>
        <input
          type="text"
          value={podName}
          onChange={(e) => setPodName(e.target.value)}
          className="w-full p-2 border rounded mb-4"
          placeholder="Enter pod name"
        />

        <button
          onClick={handleAnalyze}
          className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700 w-full"
          disabled={loading}
        >
          {loading ? "Analyzing..." : "Analyze"}
        </button>
      </div>

      {response && (
        <div className="max-w-3xl mx-auto mt-8 bg-white p-6 rounded-2xl shadow-lg">
          <h2 className="text-xl font-bold mb-4 text-gray-800">Analysis Result</h2>
          <p><strong>Pod:</strong> {response.pod}</p>
          <p><strong>Status:</strong> {response.analysis.status}</p>
          <p><strong>Problems Detected:</strong> {response.analysis.problems}</p>
          <p><strong>Responsibility:</strong> 
            <span className={`ml-2 font-semibold ${response.responsibility === "Developer" ? "text-purple-600" : response.responsibility === "DevOps" ? "text-green-600" : "text-gray-500"}`}>
              {response.responsibility}
            </span>
          </p>

          <div className="mt-4">
            {response.analysis.results.map((result, index) => (
              <div key={index} className="bg-gray-100 p-4 rounded mb-4">
                <p><strong>Kind:</strong> {result.kind}</p>
                <p><strong>Name:</strong> {result.name}</p>
                <p><strong>Errors:</strong></p>
                <ul className="list-disc list-inside">
                  {result.error.map((err, i) => (
                    <li key={i}>{err.Text}</li>
                  ))}
                </ul>
                <p className="mt-2"><strong>Suggested Solution:</strong></p>
                <pre className="bg-white p-2 rounded text-sm">{result.details}</pre>
              </div>
            ))}
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
